import { Text, View, Image, SafeAreaView, ScrollView } from 'react-native';
import { general, home } from '../style/style.js';


export default function Sidebar() {
  return (
    <Image
      style={home.icon}
      
      source={{ uri: '../assets/sidebar.svg' }}
    />
  );
}
